import "./Header.scss";

const Header = () => {
  return (
    <div className="header">
      <div className="logo">
        <img
          src="https://www.ringcentral.com/content/dam/ringcentral/images/whyringcentral/kit/kit4.png"
          alt=""
        />
      </div>
    </div>
  );
};

export default Header;
